INSERT INTO `edu_teacher` VALUES ('1', '张三', '清华大学经济学博士后，曾任中央银行行长、清华大学经管学院院长。', '清华大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1629909394962.jpg', '0', '0', '2019-10-30 14:18:46', '2023-03-08 20:44:18');
INSERT INTO `edu_teacher` VALUES ('1189389726308478977', '晴天', '中国光网络的先驱者之一，同时也是中国电信行业的著名专家，他的主要研究方向包括：光通信、接入网、NGN/NGI 以及网络演进策略。迄今为止，他已经发表了100多篇论文，并出版了9本专业书籍。从2001年至2008年，他担任中国电信集团的首席技术官一职，2008年以后，他出任中国电信集团科学技术委员会主任。目前他还担任中华人民共和国工业与信息化部科学技术委员会常务副主任，以及2014年11月成立的SDN/NFV 产业联盟理事长，新一代光传送网发展论坛(NGOF)理事长。', '清华大学', '2', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/20220301_15090467.png.jpg', '1', '0', '2019-10-30 11:53:03', '2023-05-12 21:36:01');
INSERT INTO `edu_teacher` VALUES ('1189390295668469762', '李刚', '同济大学管理工程学专业毕业，研究生学历，博士学位，苏州大学教授，博士生导师，新教育改革发起人。现任十一届全国人大常委，民进中央专职副主席，中国教育学会副会长。朱永新先后求学于江苏师范学院、上海师范大学、同济大学、复旦大学，主修教育心理学，一直攻读到博士后。20 年来，他在美国、英国、日本和国内发表有关教育的论文 200 余篇，出版了多本论著。', '同济大学', '2', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1608132867728.jpg', '2', '0', '2019-10-30 11:55:19', '2023-03-08 20:56:28');
INSERT INTO `edu_teacher` VALUES ('1189426437876985857', '王二', '中国人民大学附属中学校长，数学特级教师，现任第十届北京市政协委员，全国劳动模范，中国人民大学党委委员，中国人才研究会超常人才专业委员会副理事长、全国青少年劳技教育发明创造专业委员会主任、中国教育学会高中教育专业委员会副理事长等职务,享受国务院特殊津贴。中国数学奥林匹克高级教练员，所教学生曾获国际奥林匹克数学竞赛金牌、银牌，400余人在全国、北京市中学生数学竞赛中获奖。', '中国人民大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/2a22706a864b9835.jpg', '0', '0', '2019-10-30 14:18:56', '2019-11-12 13:37:35');
INSERT INTO `edu_teacher` VALUES ('1189426464967995393', '王五', '1962年毕业于上海师范学院数学系。现任上海中学校长。主要论著有《多项式《高中数学解题策略》忡学数学教学目的和内容的中西比锄等。现为上海市中小学数学教学研究会副理事长、全国高级中学校长委员会常务理事、IBO国际文凭组织校长委员会委员、上海市教育学会副会长、上海市数学学会常务理事兼中学数学教育委员会主任、上海市中学教师高级职称评审委员会委员兼数学学科组组长、上海师范大学兼职教授及教育硕士兼职导师。', '上海师范学院', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/2109743358.jpeg', '0', '0', '2019-10-30 14:19:02', '2019-11-12 13:37:18');
INSERT INTO `edu_teacher` VALUES ('1192249914833055746', '李四', '辽宁省盘锦市教育局局长，当代著名教育改革家。因在教育教改中的突出成绩，先后荣获省功勋教师、全国劳动模范、全国优秀班主任、全国有突出贡献的中青年专家、首届中国十大杰出青年等殊荣。兼任全国教育科研规划领导小组成员、中国中学学习科学研究会理事长、全国中语会副理事会长。著有《语文教学探索》、《班主任工作漫谈》、《家教漫谈》等书。教育思想：教育民主、科学管理。', '清华大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/2105949821.jpeg', '0', '0', '2019-11-07 09:18:25', '2019-11-12 13:37:01');
INSERT INTO `edu_teacher` VALUES ('1192327476087115778', '张晶', '现任上海市教育科学研究院副院长、研究员，华东师范大学教授、博士生导师。在上海青浦县主持了长达15年的数学教育改革实验，并进行了近十年的后续研究。多次被评为上海市劳动模范、全国劳动模范，并荣获“全国五一劳动奖章”等。是上海市首届教育功臣、享受国务院特殊津贴的专家。主要著述有《学会教学》、《教学实验论》《当代教学策略》《寻找中间地带》《教学改革的行动诠释》等。教育思想：行动教育。', '复旦大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/1668220453384.jpeg', '0', '0', '2019-11-07 14:26:37', '2023-04-06 15:20:52');
INSERT INTO `edu_teacher` VALUES ('1195337453429129218', '林鹏', '数学特级教师，享受国务院特殊津贴专家，北京附属中学副校长。曾荣获“北京市十大杰出青年”“全国优秀教师”“苏步青数学教育奖”一等奖、胡楚南优秀教学成果奖等荣誉。他的“中学数学建模和导学探索的教学模式”在中学数学界引起了极大的反响。', '北京大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/2188242325.jpeg', '0', '0', '2019-11-15 21:47:12', '2020-08-04 23:45:31');
INSERT INTO `edu_teacher` VALUES ('1289906631454273538', '王鲲鹏', '中国人民大学附中校长，北京市数学特级教师。第十届北京市政协委员，中国数学奥林匹克高级教练员。荣获北京市优秀教师、北京市劳动模范、全国三八红旗手、全国教育系统先进工作者等称号。著有《人生为一大事来》、《我的教育思想》等。', '中国人民大学', '0', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/1842852813.jpg', '0', '0', '2020-08-02 20:51:21', '2020-08-02 21:07:03');
INSERT INTO `edu_teacher` VALUES ('1290646470801776642', '张武', '国家督学，山东省潍坊市教育局局长，全国优秀教师，全国劳动模范。独创的“语文实验室计划”获全国教育实验优秀教改成果二等奖，并走上国际讲台。著有《教育随想录》、《为了自由呼吸的教育》、《学生第二〉《36天，我的美国教育之旅〉等。', '南京大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1683245391199.jpg', '1', '0', '2020-08-04 21:51:12', '2020-08-04 21:51:12');
INSERT INTO `edu_teacher` VALUES ('1290647121648709633', '李鹏', '北京师范大学心理学部教授。教书育人是他毕生的事业，“培养出超越自己、值得自己崇拜的学生”是他的教育理念。他培养出了88名博士，为中国发展心理学研究的学术梯队建设做出了重要贡献。他坚持“严在当严处，爱在细微中”的育人观，在科研上对学生严格要求，在生活中对学生关心无微不至。他是师德教育的研究者，也是高尚师德的践行者，2021年被教育部聘为全国师德师风建设专家委员会总顾问。曾获全国劳动模范、全国十佳师德标兵、北京市人民教师等荣誉。', '北京师范大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1683191081662.jpg', '1', '0', '2020-08-04 21:53:48', '2020-08-04 21:53:48');
INSERT INTO `edu_teacher` VALUES ('1290670160830558210', '王达', '南开大学物理科学学院教授。他从教28年来，潜心于光学与光子学领域的教学科研工作，积极推动中国物理学教育和科学普及，发起了中国大学生物理学术竞赛，对大学物理教育改革起到了示范作用。他以育人为根本任务，言传身教，培养出一批光学和光子学领域的优秀青年科技人才。他指导研究生在拓扑光子学、弱光非线性与光场调控、铌酸锂光电器件等领域取得多项原始创新成果，引领相关领域创新发展，部分成果应用于载人航天、航母等重大工程。曾获宝钢优秀教师奖、全国优秀科技工作者等荣誉。', '南开大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1673963639488.jpg', '0', '0', '2020-08-04 23:25:20', '2020-08-05 15:16:24');
INSERT INTO `edu_teacher` VALUES ('1290907563440754690', '杰克', '山西大学光电研究所教授。他始终牢记人民教师的光荣职责，坚持扎根于中西部，突出因材施教，注重培养学生科研兴趣，鼓励他们大胆假设、小心求证，培养出一批有理想、有本领、有担当的优秀青年人才。他坚守科技教育工作使命，瞄准国际科学前沿、国家战略需求以及地方转型发展需要，围绕“卡脖子”技术，矢志打造一流团队、完成一流成果，在国际上率先实验实现一维和两维自旋轨道耦合的简并费米气体。他坚持学高为师、身正为范、教学相长，打造有力教师团队，入选教育部“全国高校黄大年式教师团队”。曾获全国五一劳动奖章、山西省特级劳动模范等荣誉。', '山西大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1668416924194.jpg', '1', '0', '2020-08-05 15:08:42', '2020-08-05 15:08:42');
INSERT INTO `edu_teacher` VALUES ('1292097031057219585', '龙洋', '吉林农业大学农学院教授、中国工程院院士。作为菌物学学科的拓荒者，他始终以立德树人为根本，系统做好人才培养工作，经过30余年努力，他为学校建立了从专科到博士的菌物科学与食用菌工程人才培养体系和学科发展体系，培养了100多名农业技术和经营管理人才。他始终秉持教书育人初心，几十年如一日潜心教学，古稀之年仍坚持为本科生授课。他治学严谨、甘为人梯，以卓越学识和崇高品格，凝聚和培养了一代又一代教师，推动教育事业青蓝相续、薪火相传。曾获国家教学名师、全国优秀教育工作者、全国脱贫攻坚楷模等荣誉。', '吉林农业大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/-77c19ba3cee1f73c.jpg', '0', '0', '2020-08-08 21:55:13', '2020-08-08 21:55:13');
INSERT INTO `edu_teacher` VALUES ('1294175384794947586', '廖大姐', '复旦大学上海医学院教授、中国科学院院士。从教30多年来，他坚持躬耕在教学一线，关注学生全面发展，悉心引导学生在科研领域攻坚克难，为医学事业培养了大量人才。在教学工作中，他以大先生为追求，强调德才兼备，坚持以身作则，将大医情怀传递给学生，以师德培养医德，让每位学生在行医生涯中为患者带去生命之光。作为医院管理者，他忠实履行附属医院在医学教育中的责任和使命，推动建设一流医学教育，为健康中国添砖加瓦。作为医学专家，立足临床，以病人为中心，创新治疗手段，勇斗“癌王”，为病人带来希望。曾获国家科技进步二等奖、宝钢优秀教师奖等荣誉。', '复旦大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1657431390736.jpg', '0', '0', '2020-08-14 15:33:51', '2020-08-14 15:33:51');
INSERT INTO `edu_teacher` VALUES ('1630912954054598657', '陈博宇', '东南大学附属中大医院教授。他扎根教学一线30年，培养硕士、博士研究生243人，很多毕业生成为重症医学骨干力量。他在重症医学教育教学改革中做出了重要探索，修订重症医学质控指标，率先在江苏省试点重症医学专项规范技能培训和资格认证。在防控新冠肺炎疫情工作中，他秉持“重症病人在哪里，我就应该在哪里”作风，持续战斗在救治一线。', '东南大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1657431379629.jpg', '0', '0', '2023-03-01 20:48:44', '2023-03-01 21:29:50');
INSERT INTO `edu_teacher` VALUES ('1634172817689841665', '陈柏', '山东农业大学农学院教授。从教30多年来，他始终坚持“德才兼备、以德为先”的育人理念，用自己的实际行动诠释着“学为人师、行为世范”的人民教师职业准则。他教导学生学农爱农、立志为农，引导学生将个人理想融入国家发展战略，多名毕业生被评为全国劳动模范，成为行业优秀人才。他历经20年，成功克隆抗赤霉病基因Fhb7并探明其遗传和分子机理，实现了重要科技突破。', '山东农业大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/46cc36ac885cb1d1.jpg', '1', '0', '2023-03-10 20:42:16', '2023-03-10 20:42:21');
INSERT INTO `edu_teacher` VALUES ('1635506140278218754', '郑达', '武汉大学遥感信息工程学院教授、中国工程院院士。他以大先生为追求，61年坚守教学一线，无论是当副校长期间还是当院士后，都从未间断亲自上讲台授课，培养了一批又一批遥感测绘之才。他不遗余力提携后学，不拘一格使用人才，创造平台让他们施展特长，凝聚起遥感测绘研究的强大团队。他向学院捐赠100万元设立“教书育人奖”，奖励教书育人方面表现突出的优秀教师。他首次提出了数字摄影测量网格思想，研制出我国首套完全自主知识产权的航空航天遥感影像数字摄影测量网格处理系统，打破了国际软件的垄断，极大推动了我国摄影测量技术的进步与产业化发展。曾获国家自然科学奖二等奖、湖北省荆楚楷模年度人物等荣誉。', '武汉大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1658826061758.jpg', '1', '0', '2023-03-14 13:00:25', '2023-03-14 13:00:25');
INSERT INTO `edu_teacher` VALUES ('1656657733594214402', '张小静', '中南大学地球科学与信息物理学院教授、中国工程院院士。他从事高等教育及科学研究60多年，是我国电磁勘探领域的开拓者，领衔建立的电磁探测中国学派，引领国际地球物理学前沿。他为人师表，在耄耋之年仍奔波在教学科研一线，为我国深地探测战略和新能源战略的实施贡献力量。他注重教学科研创新，培养了大批高层次中青年人才，很多毕业生成为电磁勘探领域的中坚力量。', '中南大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/03/14e63cd250e4044a36b5a47ba6a1a64f5afile.png', '2', '0', '2023-05-11 21:49:18', '2023-05-11 21:49:18');
INSERT INTO `edu_teacher` VALUES ('2', '周杰伦', '华南理工大学建筑学院教授、中国科学院院士。他以大先生为追求，做建筑环境声学研究与教学领域的拓荒人与推动者，培养了众多优秀的硕士、博士毕业生，为该学科在我国的发展培养了重要的学术力量。他热爱教育事业，秉持着“熟能生巧”“他山之石，可以攻玉”“文理兼修”等教育理念，潜心教书育人，力做学生为学、为事、为人的示范。\r\n华南理工大学建筑学院教授、中国科学院院士。他以大先生为追求，做建筑环境声学研究与教学领域的拓荒人与推动者，培养了众多优秀的硕士、博士毕业生，为该学科在我国的发展培养了重要的学术力量。他热爱教育事业，秉持着“熟能生巧”“他山之石，可以攻玉”“文理兼修”等教育理念，潜心教书育人，力做学生为学、为事、为人的示范。', '华南理工大学', '1', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/2179794410.jpeg', '0', '0', '2020-08-02 16:54:17', '2020-08-02 16:54:21');
INSERT INTO `edu_teacher` VALUES ('66', '廖晓悦', '西安电子科技大学微电子学院教授、中国科学院院士。他扎根祖国西部四十年如一日，深耕讲坛、潜心育人，先后培养硕士、博士毕业生370多名。他创新教育教学理念，构建了“理论课程—实践能力—创新素质”三位一体集成电路复合型创新人才培养模式，在全国多所高校推广应用，为我国关键技术领域突破培养了大批拔尖创新人才。', '西安电子科技大学', '2', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1657431379629.jpg', '0', '0', '2020-08-03 16:44:36', '2023-03-08 20:51:25');
INSERT INTO `edu_teacher` VALUES ('999', '热巴', '宁夏大学化学化工学院教授。她扎根西部二十五载，坚守教书育人一线，在构建化工专业本科人才实践能力培养模式方面不断探索，取得扎实育人成效。她注重创新创业教育，先后指导200多名学生参加各种创新创业项目，获得各级奖励30余项。', '宁夏大学', '0', 'https://online-education-test1010.oss-cn-fuzhou.aliyuncs.com/2023/04/%E6%96%B0%E5%BB%BA%E6%96%87%E4%BB%B6%E5%A4%B9/mmexport1683430598949.jpg', '0', '0', '2020-07-27 17:18:04', '2020-08-04 17:18:08');
